import React from 'react';
import { Box, Grid } from '@mui/material';
import Base from '../components/Base';
import TableComponent from '../components/Table';

function Historic() {
  const rows = [
    {
      id: 1,
      Data: "01/12/23",
      Descrição: "Supermecado Dona Novinha",
      Total: 234.0,
      Items: [{ Nome: "test", Quantidade: 2, Valor: 12, Total: 24 }],
      view: true
    },
  ];
  const header = ["Data", "Descrição", "Total", "Items"];
  return (
    <Base title="Historico de Compras">
      <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={2} mt={2}>
          <Grid item lg={12}>
           {items && <TableComponent rows={rows} header={header} />}
          </Grid>
        </Grid>
      </Box>
    </Base>
  )
}

export default Historic;
